import React from "react";
import TimeCard from "./TimeCard";

class EntryHeading extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div className="entries-heading-container container">
                <div className="row">
                    <div className="col-6">
                        <h1 className="entries-heading">This Week</h1>
                    </div>
                    <div className="col-6">
                        <div className="btn pt-mono btn-primary pill pay-period-btn">
                            <div className="inline">October 21</div>
                            <span className="inline orange-text">  -  </span>
                            <div className="inline">October 25</div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default EntryHeading;
